                    <div class=""card-body"">
                        <h4 class=""card-title"">Cynthia Logan</h4>
                        <h6 class=""card-title"">Executive Director, M.A. Ed</h6>
                        <p>Cynthia Logan is an accomplished educator who has taught both General Education and Special Education classrooms in the United States and abroad. Her students (including Special Education population) achieved satisfactory scores on state and district assessments. After years of teaching and serving students from marginalized communities, she witnessed many negative aspects of poverty in the lives of her students. And factors that perpetuate poverty, two of which are, the lack exposure to resources and the absence of committed mentors (specially for teen.)</p>
                        <p>She successfully galvanized friends and co-workers who committed themselves to go beyond the educational curriculum and meet students physical and emotional needs. Their team was tasked with mentoring stud");
                WriteLiteral(@"ents into future leader through character development and skill acquisition. The two skills were taught and modeled good citizenship, and creating opportunities for students to connect with professionals helpful in meeting career and educational goals. During those experiences she learned that ""I care"" and ""I love you"" are two phrases that transcend every race and boundary, and motivates people to give their personal best every time.</p>
                        <p>Her ability to connect with people, especially teens, and countless interactions as a mentor helped shaped the lives of many young people she taught. Not only were her students impacted, but today she maintains lasting relationships with many of her former students and their families.</p>
                    </div>
                </div>
