                        <h4 class=""card-title"">Edwin S. Freeman</h4>
                        <h6 class=""card-title"">MBA – Finance Committee Chair</h6>
                        <p>Edwin Freeman holds two MBAs. One in Managerial Finance from Ashford University, Iowa and another MBA in Accountant /Finance from the American Intercontinental University, Atlanta. He earned his BA in Marketing from American Intercontinental University, Atlanta. He is the Risk Compliance Manager at Python Advisor with more than 12+ years of combined experience in systems analysis and software application development. He’s an energetic and experienced professional who gains the trust of individuals, achieves consensus, and maintains long-term, mutually-beneficial business relationships. Mr. Freeman is an experienced team builder and advocate for total quality level ");
                WriteLiteral(@"skills in the business and systems requirements, user acceptance testing, process improvement, and end-user training. He is a high-energy business analyst who is effective at developing and implementing operational processes and systems.</p>
                        <p>Mr. Freeman’s ability to quickly grasp business priorities to identify optimal personnel and IT solutions makes him an impactful leader. He’s an accomplished business analyst with extensive knowledge in financial and business process performance analysis. He has the ability to easily adapt, which enables him to partner closely with diverse team members to ensure successful implementation of new reporting, compliance, adherence to guidelines, and completion of goals. Mr. Freeman is a results-driven achiever with strong communication and presentation skills.</p>
                        <p>Accomplishments: PMI-PBA Professional Business Analyst Certification, CISA –Certified Information Systems Auditor, Oracle Certified Associate (OCA), Scrum Mast");
                WriteLiteral(@"er Certified (SCM), Oracle Database 11g Structured Query Language (SQL), Public Trust Security Clearance</p>
