                        <h6 class=""card-title"">Marketing Committee Chair</h6>
                        <p>Timothy A. Kephart brings over 25 years of business consulting and entrepreneurial success serving the needs of Fortune 500 companies like Equifax, General Dynamics, KRAFT Foods, Sun Microsystems, and many others. Mr. Kephart is an alumnus of University of Rochester with degrees in economics and political Science. He brings an extensive track record of entrepreneurial success as co-founder of American Sports Media, Global Technologies Group, and the American Small Business Network. His most recent entrepreneurial role is noted by a successful partnership with Assertive Industries Inc., a global fixed assets company, which help fortune 500 companies organize");
                WriteLiteral(@" and manage inventory globally.  He also has years of experience serving on the board of several non-profits and is involved with youth sports in his community.</p>
                        <p>Mr. Kephart is a team player with vast entrepreneurial success in taking ideas and establishing processes and procedures to grow them from zero revenue into thriving, self-sufficient seven-figure businesses. He also has the ability to successfully tackle a new or growing organization’s infrastructure setup, operations development, and sales and revenue generation needs. Mr. Kephart is successful in raising funds for the non-profits he serves and is a trusted, reliable, and respected professional. </p>
